const PCOLORS=["#f77189","#bb9832","#50b131","#36ada4","#3ba3ec","#e866f4"];class Bar{constructor(t,e,n,a,l,o,s){this.id=t;this.name=e;this.x_label=n;this.y_label=a;this.labels=l;this.values=o;this.log_toggle=s}}class MultiBar{constructor(t,e,n,a,l,o,s){this.id=t;this.names=e;this.x_label=n;this.y_label=a;this.labels=l;this.values=o;this.log_toggle=s}}class Hexbin{constructor(t,e,n,a,l){this.id=t;this.min=e;this.max=n;this.radius=a;console.time("bin");this.bins=l.map(function(t){var e=t.points;e.x=t.x;e.y=t.y;return e})}}class Heatmap{constructor(t,e,n,a,l){this.id=t;this.name=e;this.x_labels=n;this.y_labels=a;this.values=l}}function buildPlotDownload(e,n,a){document.getElementById("btn-download-plot-"+n).onclick=function(){var t=document.createElement("a");t.href=e.toBase64Image();t.download=a+"_"+n+".png";t.click()}}function buildTableDownload(n,t,a){document.getElementById("btn-download-table-"+t).onclick=function(){let t=new Blob([n],{type:"text/plain"});var e=document.createElement("a");e.href=URL.createObjectURL(t);e.download=a+"_table.tsv";e.click()}}function buildLogToggle(e,t){document.getElementById("btn-logscale-plot-"+t).addEventListener("change",function(t){if(t.currentTarget.checked){e.options.scales.y.type="logarithmic"}else{e.options.scales.y.type="linear"}e.update()})}function getColor(t,e){const n=(t-e)/(1-e);const a=1-n;const l=255-a*(255-179);const o=255-a*255;const s=255-a*255;const i="rgb("+l+","+o+","+s+")";return i}function buildColorSlider(t,e){document.getElementById("btn-colorscale-"+e).addEventListener("change",function(n){t.data.datasets[0].backgroundColor=t=>{const e=t.dataset.data[t.dataIndex].v;return getColor(e,n.currentTarget.value)};t.options.plugins.tooltip.callbacks={title(){return""},label(t){const e=t.dataset.data[t.dataIndex];return[e.x_label+" - ",e.y_label+":",e.v]}};t.update()})}
